import React from "react";
import { useDispatch, useSelector } from "react-redux";
import "../styles/Blog.css";
import { PostState } from "../store/index";

interface Post {
  title: string;
  author: string;
  text: string;
}

const Blog: React.FC = () => {
  const postList = useSelector<PostState, object>((state) => state.post);
  console.log(postList.title);
  return <div>Hi</div>;
};

export default Blog;
